import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './SampleQuestions.css';

const SampleQuestions = () => {
  const [questions, setQuestions] = useState([]);
  const [subjects, setSubjects] = useState([]);
  const [selectedSubject, setSelectedSubject] = useState('all');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [expandedQuestion, setExpandedQuestion] = useState(null);

  useEffect(() => {
    fetchSubjects();
    fetchQuestions();
  }, []);

  const fetchSubjects = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/subjects');
      setSubjects(response.data);
    } catch (err) {
      console.error('Error fetching subjects:', err);
    }
  };

  const fetchQuestions = async (subject = null) => {
    setLoading(true);
    setError('');
    try {
      const url = subject && subject !== 'all'
        ? `http://localhost:5000/api/sample-questions?subject=${subject}`
        : 'http://localhost:5000/api/sample-questions';

      const response = await axios.get(url);
      setQuestions(response.data);
    } catch (err) {
      setError('Failed to load questions. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const handleSubjectChange = (subject) => {
    setSelectedSubject(subject);
    fetchQuestions(subject);
    setExpandedQuestion(null);
  };

  const toggleAnswer = (questionId) => {
    setExpandedQuestion(expandedQuestion === questionId ? null : questionId);
  };

  const getDifficultyColor = (difficulty) => {
    switch (difficulty?.toLowerCase()) {
      case 'easy':
        return '#4caf50';
      case 'medium':
        return '#ff9800';
      case 'hard':
        return '#f44336';
      default:
        return '#666';
    }
  };

  return (
    <div className="sample-questions">
      <div className="questions-header">
        <h2>üìù Sample Questions</h2>
        <p>Practice questions to help you prepare for exams</p>
      </div>

      <div className="filter-section">
        <label>Filter by Subject:</label>
        <div className="subject-filters">
          <button
            className={`filter-btn ${selectedSubject === 'all' ? 'active' : ''}`}
            onClick={() => handleSubjectChange('all')}
          >
            All Subjects
          </button>
          {subjects.map((subject) => (
            <button
              key={subject}
              className={`filter-btn ${selectedSubject === subject ? 'active' : ''}`}
              onClick={() => handleSubjectChange(subject)}
            >
              {subject}
            </button>
          ))}
        </div>
      </div>

      {loading ? (
        <div className="loading">Loading questions...</div>
      ) : error ? (
        <div className="error">{error}</div>
      ) : questions.length === 0 ? (
        <div className="no-questions">No questions found.</div>
      ) : (
        <div className="questions-list">
          {questions.map((question) => (
            <div key={question.id} className="question-card">
              <div className="question-header-row">
                <span className="subject-badge">{question.subject}</span>
                <span 
                  className="difficulty-badge"
                  style={{ backgroundColor: getDifficultyColor(question.difficulty) }}
                >
                  {question.difficulty}
                </span>
              </div>
              <div className="question-text">
                <strong>Q:</strong> {question.question}
              </div>
              <button
                className="show-answer-btn"
                onClick={() => toggleAnswer(question.id)}
              >
                {expandedQuestion === question.id ? '‚ñ≤ Hide Answer' : '‚ñº Show Answer'}
              </button>
              {expandedQuestion === question.id && (
                <div className="answer-section">
                  <strong>Answer:</strong>
                  <p>{question.answer}</p>
                </div>
              )}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default SampleQuestions;
